import { Routes, Route } from "react-router-dom";
import MainPage from "./pages/MainPage";
import LanguageSwitcher from "./LanguageSwitcher";
function App() {
  return (
    <>
      <LanguageSwitcher />
      <Routes>
        <Route path="" element={<MainPage />} />
      </Routes>
    </>
  );
}

export default App;
